import React, { Component } from 'react'

class Plans extends Component {
    render() {
        console.log(process.env.REACT_APP_PLANS.split(',')[0].split(' ')[0])
        return (
            <div className='container'>
                <div className='row'>

                {process.env.REACT_APP_PLANS.split(',').map(p => 
                <div className='col s4'>
                    <div className='card-panel'>
                        <h5>{p.split(' ')[0]} </h5>
                        <p><sup>R$</sup><h4 className='amber-text'>{p.split(' ')[1]}</h4>/mes</p>
                        <a class="waves-effect waves-light amber btn">comprar</a>
                    </div>
                </div>
                )}
                </div>
            </div>
        )
    }
}

export default Plans
